    "#Loading in all the required packages and data set\n",
    "\n",
    "\n",
    "#Loading in supporting packages\n",
    "library(tidyverse)\n",
    "library(ggrepel)\n",
    "library(ggimage)\n",
    "library(nflfastR)\n",
    "library(dplyr)\n",
    "library(scatterplot3d)\n",
    "\n",
    "#Packages for Analysis\n",
    "library(caret)\n",
    "library(caretEnsemble)\n",
    "\n",
    "\n",
    "#Switching notation\n",
    "options(scipen = 9999)\n",
    "\n",
    "\n",
    "#Loading in the data\n",
    "# nflFastR doesn't properly port over to Kaggle. Below is my nflFastR code done in RStudio to convert my data to play-by-play data and then export it to kaggle. \n",
    "# The second to last line of code saves the file to a csv that could be loaded into Kaggle.\n",
    "# The last line (the only uncommented code) is importing the file into Kaggle\n",
    "\n",
    "#library(nflfastR)\n",
    "#seasons = 2010:2020\n",
    "#data <- nflfastR::load_player_stats(seasons)\n",
    "#write.csv(data, \"nfl_data.csv\")\n",
    "\n",
    "data <- read_csv(glue::glue(\"../input/my-nfl-data/my_nfl_data.csv\"))"
