   "source": [
    "# **Part 1: Modify play by play data to be season totals for Wide Recievers **"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "a8a33242",
   "metadata": {
    "papermill": {
     "duration": 0.092529,
     "end_time": "2022-02-23T21:54:56.191971",
     "exception": false,
     "start_time": "2022-02-23T21:54:56.099442",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "This next part of the data scaper will convert the play-by-play data to be season total data for each player. Then it will remove all players who aren't a reciever, and all years that aren't between 2010-2020. After that it will remove columns (recorded stats) that don't relate to wide recievers. \n",
    "\n",
    "**Position Selection:**\n",
    "I am specifically looking at WR value because it is a position of growing importance in the NFL. With the importance of the position growing. Having an edge in determining which WRs are more valuable than others can give an NFL a team in edge in team building. \n",
    "\n",
    "**Reason for time frame:**\n",
    "This data is from nflfastR. It is a set of functions used to effectively scrape NFL play-by-play data. Includes play-by-play data dating back to 1999. For the purpose of this analysis we will be looking at 2010-2020. This is because this follows the 16 game schedule and takes essentially the most recent 10 year period."
   ]
  },
