   "source": [
    "#Removing the dataframe if it already exists. This will prevent the dataframe from containing unwanted information.\n",
    "rm(PlayerSeasonDataFrame)\n",
    "\n",
    "\n",
    "#####Structuring data to run in Forloop#####\n",
    "\n",
    "#Creating the dataframe and creating a test dummy player to set the width of the dataframe\n",
    "#Every variable you want to have in the dataframe needs to be in the test dummy\n",
    "#If you want to look at additional data, add the variable name and a value into the test dummy player below.\n",
    "PlayerSeasonDataFrame <- data.frame(player_id = 00-0000000, player_name = \"Test Player\", season = 2999, targets = 500, receptions = 500, receiving_tds = 500, receiving_yards = 500, receiving_air_yards= 500,receiving_yards_after_catch=500, receiving_first_downs=500, receiving_epa=500, receiving_fumbles=500,receiving_fumbles_lost=500, carries=500, rushing_yards=500, rushing_tds=500, rushing_first_downs=500, rushing_epa=500, fantasy_points=500,fantasy_points_ppr=500)\n",
    "\n",
    "#Manipulating the player_id column to be a factor (which can be used to iterate through) and seperating them using levels. \n",
    "numericPlayerID <- as.factor(data$player_id)\n",
    "numPlayerID <- levels(numericPlayerID)\n",
    "\n",
    "#used for testing to make the loops more specific.\n",
    "#numPlayerID <- numPlayerID[1]\n",
    "\n",
    "#Creating the variable seasons. That way my DF includes the years I want.\n",
    "#The decision to do 2010 to 2020 is to look at the most recent decade of football, which is the revolution of the passing game. I figure WR value is probably going to be different from 1999:2009, the first decade of recorded data because teams used to think there was more value in the running game than there actually was. \n",
    "seasonTotals <- 2010:2020"
   ]
  },
