    "#####ForLoop that generates all players season totals in the database#####\n",
    "\n",
    "for (wr in numPlayerID){\n",
    "  for (seasonYear in seasonTotals){\n",
    "    LoopOutput <- data %>% \n",
    "      select(player_id, player_name, season, targets, receptions, receiving_tds, receiving_yards, receiving_air_yards,receiving_yards_after_catch, receiving_first_downs, receiving_epa, receiving_fumbles,receiving_fumbles_lost, carries, rushing_yards, rushing_tds, rushing_first_downs, rushing_epa, fantasy_points,fantasy_points_ppr) %>% \n",
    "      filter(player_id == wr , season == seasonYear)\n",
    "    if(nrow(LoopOutput >0)){\n",
    "      #Summing up columns into a vector that is easy to manipulate.\n",
    "      LoopOutput2 = colSums(LoopOutput[ sapply(LoopOutput, is.numeric)] )\n",
    "      #Changing the vector into a dataframe.\n",
    "      LoopOutput3 = as.data.frame(t(LoopOutput2))\n",
    "      #print(LoopOutput3)\n",
    "      #Adding the columns that weren't in the vector/dataframe that I now want in the dataframe.\n",
    "      LoopOutput3$player_id <- LoopOutput$player_id[1]\n",
    "      LoopOutput3$player_name <- LoopOutput$player_name[1]\n",
    "      LoopOutput3$season <- LoopOutput$season[1]  \n",
    "  #PlayerSeasonDataFrame[wr,] <- LoopOutput3\n",
    "  #if(LoopOutput3$player_id == PlayerSeasonDataFrame$player_id | LoopOutput3$season == PlayerSeasonDataFrame$season){next}\n",
    "      PlayerSeasonDataFrame[nrow(PlayerSeasonDataFrame) + 1,] = c(LoopOutput3$player_id, LoopOutput3$player_name, LoopOutput3$season, LoopOutput3$targets, LoopOutput3$receptions, LoopOutput3$receiving_tds, LoopOutput3$receiving_yards, LoopOutput3$receiving_air_yards, LoopOutput3$receiving_yards_after_catch, LoopOutput3$receiving_first_downs, LoopOutput3$receiving_epa, LoopOutput3$receiving_fumbles, LoopOutput3$receiving_fumbles_lost, LoopOutput3$carries, LoopOutput3$rushing_yards, LoopOutput3$rushing_tds, LoopOutput3$rushing_first_downs, LoopOutput3$rushing_epa, LoopOutput3$fantasy_points, LoopOutput3$fantasy_points_ppr)\n",
    "    }\n",
    "  }\n",
    "}\n"
   ]
  },
