   "source": [
    "This next chunk will remove players who did not have enough receptions in a season. Per https://www.teamrankings.com/nfl/stat/pass-attempts-per-game Baltimore threw the ball the least in 2020 at 25.9, the most was Pittsburg at 42.6. There is a similar difference each season between the top team and the bottom team dating back to 2010. It should be noted that 8 teams fall between 34-36 attempts per game. Therefore the median number of targets a game to look at is 35. \n",
    "\n",
    "In any given season, a team throws the ball a median of 560 (35 x 16) times over the course of a season. The most targeted player was Stefon Diggs at 167 targets. On a median team this is 29.71 percent of a teams target share per game. Looking at the data there are several WRs who sit around a relatively similar percentage of target share for their respective teams. These players would be identified as WR1.\n",
    "\n",
    "But for the purpose of manipulating the data we want to include recievers that are contributing as the 2nd, 3rd, or even 4th option on a team. An arbitrary deliniation for this can be someone who has a third of the contribution of the WR1 (between 10-15% of teams target share) which is 56 targets over the course of a season, or 3.5 times per game. Looking at the data, when we make this deliniation it passes the eye test of wide recievers who will play every week of the season as team contributors."
   ]
  },
