    "#Removes players who are below 56 targets in a season\n",
    "\n",
    "#Note: The first line of this code mostly achieves the goal but for some reason single digit targets avoided the filter.\n",
    "modifiedOutput <- filter(PlayerSeasonDataFrame, targets >= 56)\n",
    "#Note: This code removes the single digits.\n",
    "modifiedOutput <- modifiedOutput[!(modifiedOutput$targets == 6),]\n",
    "modifiedOutput <- modifiedOutput[!(modifiedOutput$targets == 7),]\n",
    "modifiedOutput <- modifiedOutput[!(modifiedOutput$targets == 8),]\n",
    "modifiedOutput <- modifiedOutput[!(modifiedOutput$targets == 9),]\n",
    "modifiedOutput <- modifiedOutput[!(modifiedOutput$player_id=='00-0000000'),]\n"
   ]
  },
