    "# **Part 2: Creating Second Level Metrics **"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "2841d74b",
   "metadata": {
    "papermill": {
     "duration": 0.094585,
     "end_time": "2022-02-23T21:56:48.555676",
     "exception": false,
     "start_time": "2022-02-23T21:56:48.461091",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "**This section creates some advanced and second level metrics for WRs that may help provide some insight into WR vaue.**\n",
    "\n",
    "1) Catch Target Percentage: Receptions / Targets ----- Percentage of targets a WR. catches. I feel at the very least this should be a correlation for who a QB trusts. This could manifest itself in 3rd down scenarios.\n",
    "\n",
    "2) Touchdown Target Percentage: Touchdowns / Targets ---- How many of a receivers receptions are touchdowns.\n",
    "\n",
    "3) Yards Per Target: Receiving Yards / Targets ------ There is probably a lot of noise that is within this stat, but in theory the larger this value is, the more valuable the receiver. \n",
    "\n",
    "4) Air Yards Per Target: Receiving Air Yards / Targets\n",
    "\n",
    "5) Receiving Yards After Catch Per Reception: Receiving Yards After Catch / Receptions\n",
    "\n",
    "6) Target First Down Percentage:  Receiving First Downs / Targets ------- I figure this will favor TEs and possesion WRs. Players who are generally considered reliable targets who won't get as much yards after the catch. \n",
    "\n",
    "7) Fantasy Points Per Target \n",
    "\n",
    "8) Average depth of Target: (Receiving Yards - Receiving Yards After Catch) / Targets -------- This will help us know at one point from the line of scrimmage the QB is throwing the WR the ball. Hence does the WR tend to be more of a deep ball receiver, a crosser, or possession receiver. \n",
    "\n",
    "9) Average Depth of Reception:  (Receiving Yards - Receiving Yards After Catch) / Receptions ------- Chunk plays help move an offense down the field, it would make sense that WRs who have a deeper average depth of reception would be more valuable. \n",
    "\n",
    "10) Epa per target"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 9,
   "id": "f13dc7ef",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2022-02-23T21:56:48.752012Z",
     "iopub.status.busy": "2022-02-23T21:56:48.750161Z",
     "iopub.status.idle": "2022-02-23T21:56:48.804990Z",
     "shell.execute_reply": "2022-02-23T21:56:48.803703Z"
    },
    "papermill": {
     "duration": 0.155152,
     "end_time": "2022-02-23T21:56:48.805149",
     "exception": false,
     "start_time": "2022-02-23T21:56:48.649997",
