   "outputs": [],
   "source": [
    "#Reading in the csv file we completed in part 1\n",
    "WR_df <- read.csv(file = \"wr_dataframe.csv\")\n",
    "\n",
    "#1) Catch Target Percentage\n",
    "WR_df$catch_target_percentage <- WR_df$receptions / WR_df$targets\n",
    "\n",
    "#2) Touchdown Target Percentage\n",
    "WR_df$touchdown_target_percentage <- WR_df$receiving_tds / WR_df$targets\n",
    "\n",
    "#3) Yards Per Target\n",
    "WR_df$yards_per_target <- WR_df$receiving_yards/WR_df$targets\n",
    "\n",
    "#4) Air Yards Per Target\n",
    "WR_df$air_yards_per_target <- WR_df$receiving_air_yards/WR_df$targets\n",
    "\n",
    "#5) Recieving Yards After Catch Per Catch\n",
    "WR_df$receiving_yards_after_catch_per_reception <- WR_df$receiving_yards_after_catch/WR_df$receptions\n",
    "\n",
    "#6) Target First Down Percentage\n",
    "WR_df$target_first_down_percentage <- WR_df$receiving_first_downs / WR_df$targets\n",
    "\n",
    "#7) Fantasy Points Per Target \n",
    "WR_df$fantasy_points_per_target <- WR_df$fantasy_points_ppr / WR_df$targets\n",
    "\n",
    "#8) Average depth of Target\n",
    "WR_df$average_depth_of_target <- (WR_df$receiving_yards - WR_df$receiving_yards_after_catch) / WR_df$targets\n",
    "\n",
    "#9) Average Depth of Reception\n",
    "WR_df$average_depth_of_reception <- (WR_df$receiving_yards - WR_df$receiving_yards_after_catch)/ WR_df$receptions\n",
    "\n",
    "#10) EPA per Target\n",
    "WR_df$epaAdjusted <- WR_df$receiving_epa/WR_df$targets\n",
    "\n",
    "#11) Targets per game\n",
    "WR_df$avg_targets <- WR_df$targets/16\n",
    "\n",
    "#12) Receptions per game\n",
    "WR_df$avg_receptions <- WR_df$receptions/16\n",
    "\n",
    "#Saving the ready to analyze dataframe to a csv file.\n",
    "write.csv(WR_df, \"wr_dataframe_advanced.csv\")"
   ]
  },
