   "source": [
    "#Scatterplot Data Exploration\n",
    "plot(WR_df$targets, WR_df$receptions, main = \"Scatterplot of Targets vs Receptions\", xlab = \"Targets\", ylab = \"Receptions\")\n",
    "abline(lm(WR_df$receptions~WR_df$targets), col=\"blue\", lwd = 2)\n",
    "\n",
    "\n",
    "plot(WR_df$targets, WR_df$receiving_tds, main = \"Scatterplot of Targets vs Rec. TDs\", xlab = \"Targets\", ylab = \"Rec. TDs\")\n",
    "abline(lm(WR_df$receiving_tds~WR_df$targets), col=\"blue\", lwd = 2)\n",
    "\n",
    "\n",
    "plot(WR_df$targets, WR_df$receiving_yards, main = \"Scatterplot of Targets vs Rec. Yards\", xlab = \"Targets\", ylab = \"Rec. Yards\")\n",
    "abline(lm(WR_df$receiving_yards~WR_df$targets), col=\"blue\", lwd = 2)\n",
    "\n",
    "\n",
    "plot(WR_df$targets, WR_df$average_depth_of_target, main = \"Scatterplot of Targets vs Average Depth of Target\", xlab = \"Targets\", ylab = \"Average Depth of Target\")\n",
    "abline(lm(WR_df$average_depth_of_target~WR_df$targets), col=\"blue\", lwd = 2)\n",
    "\n",
    "\n",
    "plot(WR_df$targets, WR_df$catch_target_percentage, main = \"Scatterplot of Targets vs Catch Target Percentage\", xlab = \"Targets\", ylab = \"Catch Target Percentage\")\n",
    "abline(lm(WR_df$catch_target_percentage~WR_df$targets), col=\"blue\", lwd = 2)\n",
    "\n",
    "\n",
    "plot(WR_df$targets, WR_df$receiving_epa, main = \"Scatterplot of Targets vs Receiving EPA\", xlab = \"Targets\", ylab = \"Receiving EPA\")\n",
    "abline(lm(WR_df$receiving_epa~WR_df$targets), col=\"blue\", lwd = 2)\n",
    "\n",
    "\n",
    "plot(WR_df$targets, WR_df$fantasy_points_ppr, main = \"Scatterplot of Targets vs Receiving EPA\", xlab = \"Targets\", ylab = \"Fantasy Points PPR\")\n",
    "abline(lm(WR_df$fantasy_points_ppr~WR_df$targets), col=\"blue\", lwd = 2)\n"
   ]
