   "source": [
    "This link is to find all of the different machine learning methods available in the caret package. https://rdrr.io/cran/caret/man/models.html\n",
    "\n",
    "Key Definitions:\n",
    "Bagging: Also known as Bootstrap Aggregation. This is an ensemble technique that combines the predictions from multiple machine learning algorithms together to make more accurate predictions than any individual models. This is done by averaging each of the models predictions. Models that tend to have high variance and therefore can benefit from bagging in Machine Learning are decision trees, classification, and regression trees. \n",
    "\n",
    "Cross Validation: Also known as resampling validation or out-of-bootstrap validation. Rotates the data around so that all of it will be part of a subset of testing and a subset of training at some point in the cross validation process. Necessary for smaller datasets.\n",
    "\n",
    "MAE: A measure of error between paired observations expressing the same phenomenon. The arithmetic avergae of the absolute errors. Lower is better.\n",
    "\n",
    "RMSE: The standard deviation of the residuals (prediction errors). Residuals are a measure of how far from the regression line data points are. Lower is better. https://www.statisticshowto.com/probability-and-statistics/regression-analysis/rmse-root-mean-square-error/ "
   ]
  },
