   "source": [
    "#Normalizing the Data to be values between 0-1 as to not cause the model to overweight specific variables.\n",
    "min_max_norm <- function(x) {\n",
    "    (x - min(x)) / (max(x) - min(x))\n",
    "  }\n",
    "wr_norm <- as.data.frame(lapply(dataset[4:24], min_max_norm))\n",
    "\n",
    "wr_norm$season <- dataset$season\n",
    "wr_norm$player_name <- dataset$player_name\n",
    "wr_norm$player_id <- dataset$player_id\n",
    "\n",
    "wr_norm <- wr_norm %>% relocate(player_id)\n",
    "wr_norm <- wr_norm %>% relocate(player_name, .after = player_id)\n",
    "wr_norm <- wr_norm %>% relocate(season, .after = player_name)\n",
    "\n",
    "head(wr_norm)"
   ]
  },
