   "source": [
    "#Linear Regression Normalized with k-fold cross validation\n",
    "\n",
    "#Conclusion Based of this Chunk: \n",
    "#The results here show that none of my created advanced stats are strong predictors of targets. \n",
    "#The Rsquared (explaination of targets) is 9.138% explained by the selected variables. \n",
    "#In essense, this model doesn't provide a strong explaination for why a reciever gets targets.\n",
    "\n",
    "#Define training control\n",
    "set.seed(123)\n",
    "train.control1 <- trainControl(method = \"repeatedcv\", number = 5, repeats = 3)\n",
    "\n",
    "#Train the model\n",
    "lrModel <- train(targets ~ catch_target_percentage + touchdown_target_percentage + air_yards_per_target + receiving_yards_after_catch_per_reception + target_first_down_percentage + fantasy_points_per_target, data= wr_norm, method=\"lm\", trControl=train.control1)\n",
    "\n",
    "lrModel"
   ]
  },
